export default function updateStudentGradeByCity(students, city, newGrades) {
  const ids = newGrades.map((student) => student.studentId);
  const newArray = students.filter((student) => student.location == city).map((student) => {
    if(!ids.includes(student.id)) {
      return {...student, grade: 'N/A'};
    }
    return {...student, grade: newGrades.filter((item) => item.studentId == student.id)[0].grade};
  }) 
}

